  namespace: NDSH.Geospatial.Metadata
  summary: >-
    Represents a specific value within a registered code list, ensuring standardized

    categorization and reference. This class implements multiple metadata interfaces

    to provide comprehensive code list support as per the ISO 19115 metadata standard.
  remarks: >-
    <p>
      The <xref href="NDSH.Geospatial.Metadata.CodeListValue_Type" data-throw-if-not-resolved="false"></xref> class allows referencing an external code list value,
      supporting interoperability across metadata systems. It provides attributes to store the
      code list URI, the selected value within the list, and an optional code space.
    </p>

    <p>
      <b>Considerations:</b>
      <ul><li>
          The <xref href="NDSH.Geospatial.Metadata.CodeListValue_Type.CodeList" data-throw-if-not-resolved="false"></xref> and <xref href="NDSH.Geospatial.Metadata.CodeListValue_Type.CodeListValue" data-throw-if-not-resolved="false"></xref> properties are required attributes.
        </li><li>
          The <xref href="NDSH.Geospatial.Metadata.CodeListValue_Type.CodeSpace" data-throw-if-not-resolved="false"></xref> property is optional but recommended for unambiguous referencing.
        </li></ul>
    </p>

    <p>
       Maps to: <code>CodeListValue_Type</code> ( /2005/gco/gcoBase.xsd )
    </p>
